import React from "react";

function PatientDashboard({ user }) {
  if (!user) {
    return <p>กรุณาเข้าสู่ระบบก่อน</p>;
  }

  return (
    <div className="bg-white shadow p-6 rounded-lg">
      <h2 className="text-2xl font-bold mb-4">Patient Dashboard</h2>
      <p>ยินดีต้อนรับคุณ <span className="font-semibold">{user.username}</span></p>
      <p>Role: {user.role}</p>

      {/* ตัวอย่างข้อมูลที่จะโชว์ */}
      <div className="mt-4">
        <h3 className="font-semibold">การนัดหมายของคุณ</h3>
        <ul className="list-disc pl-6">
          <li>ตรวจฟัน - 1 ก.ย. 2025</li>
          <li>ขูดหินปูน - 10 ก.ย. 2025</li>
        </ul>
      </div>
    </div>
  );
}

export default PatientDashboard;
